import './SideBar.css';


const SideBar = ({sidebar}) => {

    return (
        <div className={sidebar?"sidebar sidebar--open":"sidebar"}>
            <li><i class="ri-home-line"></i>Home</li>
            <li><i class="ri-creative-commons-by-fill"></i>Balls</li>
        </div>
    );
};

export default SideBar;
